import Form from './Form';
import { useState, useEffect } from 'react';
export default function EventData(props) {

    const API_URL =
    "https://api.846policebrutality.com/api/incidents?&filter%5Bstate%5D=";
    const [link, setLink] = useState();
    const [searchString, setSearchString] = useState("California");
    const [results, setResults] = useState([]);
    const getData = async () => {
        // const {id} = props.match.params;
        try {
        const response = await fetch(API_URL + searchString);
        const data = await response.json();
        setResults(data.data);
        console.log(data.data)
        }catch(err){
            console.log(err);
        }
      };
      useEffect(() => {
        getData();
      }, []);
    return (
        results.length &&
            results.map((ele, i) => {
                return (
              <div className="d3">
                  <p>{ele.title}</p>
              <a href={`/details/${ele.id}`}key={i}>{ele.links}</a>

              </div>)
}))
}
